import {CREATE_DATA, START_POST_REQUEST, START_PUST_REQUEST} from "../types"

const saveDataStore = (data)=>{
    
    return {
        type: CREATE_DATA,
        payload: data
    }
}

const start_POST_RequestServer = ()=>{
    
    return{ 
        type: START_POST_REQUEST
    }
}
const start_PUT_RequestServer = ()=>{
    
    return{ 
        type: START_PUST_REQUEST
    }
}

export {saveDataStore, start_POST_RequestServer, start_PUT_RequestServer}
